import React from "react";

const Button = ({ icon, caption, onClick }) => {
  return (
    <button class="button-p r pt12 pb12 pl4 pr4" onClick={onClick}>
      <span style={{ backgroundImage: icon }}></span>
      <span>{caption}</span>
    </button>
  );
};

export default Button;
